import Workout1 from "./Workout1";
import Workout2 from "./Workout2";
import Header from "./common/Header";
import HomePage from "./HomePage";
import { Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div>
      <Header />
      <HomePage />
      <Workout1 />
      <Workout2 />
    </div>,    
    document.getElementById('root')
  ) 
}

export default App;
